  var nav = document.getElementById("navbarNav");
  var btn = document.getElementById("navbarBtn");
  nav.classList.remove("show");
  btn.classList.add("collapsed");
};

function App() {
  const [isNavCollapsed, setIsNavCollapsed] = useState(true);

  const handleNavCollapse = () => setIsNavCollapsed(!isNavCollapsed);
  return (
    // <div className="App">
    //   <Header/>
    //   <NavigationPage/>
    //   <FirstPage/>
    //   <HelloMessage name="Thierry" name2="Thierry2"/>
    // </div>
    <Router>
        <div className="">
          <div className="mb-5 container-fluid">
            <nav id="MyNavBarId" className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
              <button id="NavBarButton" className="navbar-toggler" data-toggle="collapse" data-target="#NavBarCollaps" aria-controls="navbar" aria-expanded="false" aria-label="Toggle navigation">
                <span id="" className="navbar-toggler-icon"></span>
              </button>
              <div id="NavBarCollaps" className="collapse navbar-collapse justify-content-between">
                <p><Link to={'/livret'} className="navbar-brand" onClick={handleCollapse}> Afficher le Livret de Famille </Link></p>
                <p><Link to={'/arbre'} className="navbar-brand"> Afficher l'Arbre de la Famille </Link></p>
                <p><Link to={'/album'} className="navbar-brand"> Afficher l'Album </Link></p>
              </div>
            </nav>
          </div>
          <hr />
          <div className="container mt-5" id="mainId">
            <Routes>
              <Route exact path="/livret" element={<LivretPage/>} />
              <Route path="/arbre" element={<ArbrePage/>} />
              <Route path="/album" element={<AlbumPage/>} />
            </Routes>
          </div>
        </div>
        <FooterPage/>
      </Router>
  );
}

export default App;
